import React,{Component} from 'react';
class Frame extends Component{
    constructor (props) {
        super(props)
        this.state = {
          anh :'http://localhost:4000/anh/' + this.props.anh
        
        }
     }
     
    render(){
        return(
           
            <div>
                <img   src={this.state.anh}  ></img>
                <p>{this.props.ten} </p>
                <b>{this.props.gia}</b>
            </div>
        )
}}
export default Frame
